import { useState } from 'react';

function ImagePlaceholder(){
  return (<div style={{backgroundColor: "green", height: "50px"}}></div>);
}

function TopMenu(){
  return (
    <div class="greenBackground">
      <ul>
        <li><a href="#forside">Forside</a></li>
        <li><a href="#zoneterapi">Zoneterapi</a></li>
        <li><a href="#healing">Healing</a></li>
        <li><a href="#reaktion">Reaktion på behandling</a></li>
        <li><a href="#kontakt">Kontakt</a></li>
        <li><a href="#earfaringer">Erfaringer</a></li>
        <li><a href="#priser">Priser</a></li>
        <li><a href="#booking">Online booking</a></li>
      </ul>
    </div>
  );
}

function Temp(){
  return <div>
    <ImagePlaceholder/>
    <TopMenu/>
    </div>
}

export default function App() {
  return <Temp />;
}





function FilterableProductTable({products}){
  const [filterText, setFilterText] = useState('');
  const [inStockOnly, setInStockOnly] = useState(false);

  return (
      <div>
        <SearchBar 
          filterText={filterText}
          inStockOnly={inStockOnly} 
          onFilterTextChange={setFilterText}
          onInStockOnlyChange={setInStockOnly}
        />
        <br></br>
        <ProductTable 
            products={products} 
            filterText={filterText}
            inStockOnly={inStockOnly} 
          />
      </div>
    );
}

function SearchBar({filterText, inStockOnly, onFilterTextChange, onInStockOnlyChange}){
  return (
      <form>
        <input type="text" 
          placeholder="Search..." 
          value={filterText}
          onChange={(e) => onFilterTextChange(e.target.value)}
        />
        <br></br>
        <label>
          <input type="checkbox" 
            checked={inStockOnly}
            onChange={(e) => onInStockOnlyChange(e.target.checked)}
          />
          {' '}
          Only show products in stock
        </label>
      </form>
    );
}

function ProductTable({products, filterText, inStockOnly}){
    const rows = [];
    let lastCategory = null;

    products.forEach((product) => {
      if(product.name.toLowerCase().indexOf(
        filterText.toLowerCase()) === -1 ){
        return;
      }
      if(inStockOnly && !product.stocked){
        return;
      }
      if (product.category !== lastCategory) {
        rows.push(
          <ProductCategoryRow
            category={product.category}
            key={product.category} />
        );
      }
      rows.push(
        <ProductRow
          product={product}
          key={product.name} />
      );
      lastCategory = product.category;
    });

    return (
        <table>
            <thead>
                <tr>
                    <th>Name</th>
                    <th>Price</th>
                </tr>
            </thead>
            <tbody>
                {rows}
            </tbody>
        </table>
    )
}

function ProductCategoryRow( {category} ){
    return (
        <tr>
            <th colSpan="2">
                {category}
            </th>
        </tr>
    )
}

function ProductRow( {product} ){
    const name = product.stocked ? product.name :
    <span style={{color:'red'}}>
        {product.name}
    </span>

    return (
        <tr>
            <td>{name}</td>
            <td>{product.price}</td>
        </tr>
    )
}


const PRODUCTS = [
    {category: "Fruits", price: "$1", stocked: true, name: "Apple"},
    {category: "Fruits", price: "$1", stocked: true, name: "Dragonfruit"},
    {category: "Fruits", price: "$2", stocked: false, name: "Passionfruit"},
    {category: "Vegetables", price: "$2", stocked: true, name: "Spinach"},
    {category: "Vegetables", price: "$4", stocked: false, name: "Pumpkin"},
    {category: "Vegetables", price: "$1", stocked: true, name: "Peas"}
  ];
